  false,\n\t\"url\": null,\n\t\"notes\": \"The Version 6 product provides information
  about annual (yearly) Net Primary Production at 500 meter pixel resolution. Annual
  NPP is derived from the sum of the 45, 8-day Net Photosynthesis (PSN) products from
  the given year. The PSN value is the difference of the GPP and the Maintenance Respiration
  (MR) (GPP-MR). Information on individual MODIS Net Primary Production Products along
  with improvements/changes for Version 6 are available at: https://lpdaac.usgs.gov/dataset_discovery/?f[0]=im_field_dataset_version%3A32&f[1]=im_field_product%3A8\",\n\t\"license_title\":
